def longest_range_of_friends(N, A):
    dic = {}
    for i in range(N):
        if A[i] in dic:
            dic[A[i]] += 1
        else:
            dic[A[i]] = 1
    ma = 1
    tp = ''
    for i in dic:
        if dic[i] > ma:
            ma = dic[i]
            tp = i
    dic = {}
    prev = -1
    c = 0
    for i in range(N):
        if A[i] != prev:
            if prev != -1:
                if prev in dic:
                    dic[prev].append(c)
                else:
                    dic[prev] = [c]
            c = 1
            prev = A[i]
            if i == N - 1:
                if prev in dic:
                    dic[prev].append(c)
                else:
                    dic[prev] = [c]
        else:
            c += 1
            if i == N - 1:
                if prev in dic:
                    dic[prev].append(c)
                else:
                    dic[prev] = [c]
    li = []
    for i in dic:
        nli = dic[i]
        nli.sort(reverse=True)
        li.append([i, nli, 1, nli[0]])
    ans = []
    for i in range(N + 1):
        tempmax = []
        for j in range(len(li)):
            nli = li[j][1]
            tempmax.append(li[j][3])
            if li[j][2] < len(nli):
                li[j][3] += nli[li[j][2]]
                li[j][2] += 1
        ans.append(max(tempmax))
    return ans

